Urocze mieszkanie na parterze

 Do sprzedaży mieszkanie o powierzchni całkowitej 46 m2. Cena sprzedaży wynosi 245 000 zł. Mieszkanie znajduje się w domu wielorodzinnym z 2004r., na parterze. Mieszkanie jest jednopoziomowe, ilość pokoi 2, aneks kuchenny, balkon / taras. Do mieszkania przynależy miejsce parkingowe. Stan techniczny lokalu - dobry, stan techniczny budynku - dobry, standard wyposażenia mieszkania - dobry.

LOKALIZACJA: Mieszkanie znajduje się w centrum na kameralnym osiedlu. W okolicy znajdują się sklep spożywczy, rynek, ulica handlowa, centrum handlowe, przedszkole, podstawówka, gimnazjum. Komunikacja miejska - autobus.

EKSPLOATACJA: Czynsz administracyjny wynosi 150 zł, opłaty zawarte w czynszu to: woda, śmieci, utrzymanie porządku, fundusz remontowy. Dodatkowe opłaty za media: prąd, woda, gaz, TV. Rodzaj ogrzewania - gazowe, średnie miesięczne koszty ogrzewania zimą wynoszą 220 zł.

WYDANIE MIESZKANIA - w przeciągu 2 miesięcy

 UKŁAD POMIESZCZEŃ: Mieszkanie posiada następujące pomieszczenia:
- pokój - 12 m2, umeblowane, ogrzewanie - grzejniki, okna - północ;
- salon - 17 m2, umeblowane, ogrzewanie - grzejniki, okna - południe;
- kuchnia - 6 m2, z wyposażeniem, ogrzewanie - grzejniki, okna - południe;
- łazienka - 4 m2, z wyposażeniem, ogrzewanie - grzejniki;
- pom. gospodarcze - 2 m2;
- pom. gospodarcze - 2 m2;

DODATKOWE INFORMACJE:

Mieszkanie w zabudowie szeregowej w segmencie środkowym. 
Mieszkanie sprzedawane bez umeblowania (z wyjątkiem wyposarzenia kuchni i łazienki).

